import React from 'react';

const ProgressBar = (props) => {
    console.log(props.languages)
    return (
        <div className={props.className}>
            <h3>
               {props.title} 
               <div className="years">
                   <span>Années d'expérience</span>
                   <span>1 an</span>
                   <span>2 ans</span>
               </div>
            </h3>
       </div>
    );
};

export default ProgressBar;
